import axios from 'axios';

const url = "https://specifications.vinaudit.com/v3/selections?key=9NSOAST0U19Z4HH&list=year=2019+make+model+trim&format=json";

function setRequest(vehicle) {
    return {
        type: "SET_REQUEST",
        vehicle
    }
}

export function getVehicle() {
    return dispatch => {
        axios.get(url).then(res => {
            dispatch(setRequest(res.data))
        }).catch(err => {
            console.log(err)
        })
    }
}

export default function reducer(vehicle = [], action) {
    switch(action.type) {
        case "SET_REQUEST":
            return action.vehicle
        default: 
            return vehicle
    }
}
